import React, { Component } from 'react';
import '../css/Header.css';

const MENU = [
    {
        id : 0,
        name : "Home",
        href : "#home"
    },
    {
        id : 1,
        name : "About",
        href : "#about"
    },
    {
        id : 2,
        name : "Skills",
        href : "#skills"
    },
    {
        id : 3,
        name : "Projects",
        href : "#projects"
    },
    {
        id : 4,
        name : "Contact",
        href : "#contact"
    }
]

class Header extends Component{
    render() {
        return (
            <div id="menu">
                {MENU.map((menu, index) => (
                    <a key={menu.index} href={menu.href}>{menu.name}</a>
                ))}
            </div>
        )
    }
}

export default Header;
